import React from "react";
import {useTable} from "react-table";

function Table({ columns, data }) {
    return (
    <table>
        <thead>
            <tr>
                {columns.map((column) => (
            <th key={column}>{column}</th>
                ))}
            </tr>
        </thead>
        <tbody>
            {data.map(({ name, email, phone }) => (
                <tr key={name + email + phone}>
                <td>{name}</td>
                <td>{email}</td>
                <td>{phone}</td>
                </tr>
            ))}
        </tbody>
    </table>
    );
}

export default Table;
